    const ListStyle={
        backgroundColor:"blue",
        flex:1,
        display:'flex',
        flexDirection: 'row',
        justifyContents: 'center'
    }
    return(
        <div className="Container" style={ListStyle}>
        {/* {cur.map(item=>(
            <Elem cur={item}/>
        ))} */}
            <p style={{width:100, backgroundColor:"red"}}>List Presenter</p>
            <p style={{width:100, backgroundColor:"red"}}>List Presenter</p>
            <p style={{width:100, backgroundColor:"red"}}>List Presenter</p>
        </div>
    );
}   
export default ListPresenter;
